import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <h2>Welcome to IIT Dharwad Marketplace & Carpool</h2>
      <p>This platform allows IIT Dharwad students to buy and sell used items and coordinate carpooling efficiently.</p>
    </div>
  );
}

function Buy() {
  return <h2>Buy Page</h2>;
}

function Sell() {
  return <h2>Sell Page</h2>;
}

function Carpool() {
  return <h2>Carpool Page</h2>;
}

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/buy">Buy</Link></li>
            <li><Link to="/sell">Sell</Link></li>
            <li><Link to="/carpool">Carpool</Link></li>
          </ul>
        </nav>
        <Routes>
          <Route path="/buy" element={<Buy />} />
          <Route path="/sell" element={<Sell />} />
          <Route path="/carpool" element={<Carpool />} />
          <Route path="/" element={<Home />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
